import React from "react";
import ReactDOM from "react";
import "./App.css";

function Welcome(props) {
  const user = "Emma";
  return (
    <div id="root">
      <h1>Taste of CLE</h1>
      <p>Welcome, {user}</p>
      <p>Pick your favorite recipe:</p>
      <ol>
        <li>Mushroom Soup</li>
        <li>Kale Salad</li>
        <li>Strawberry Cake</li>
      </ol>
    </div>
  );
}

ReactDOM.render(Welcome, document.getElementById("root"));

/* export default Welcome; */
